this.init = () => {
  this.camera = new THREE.PerspectiveCamera( 75, WW / HH, 1, 10000 )
  this.camera.position.z = 1000
}

this.process = () => {
  this.camera.aspect = WW / HH
  this.camera.updateProjectionMatrix()
  return {
    Camera: this.camera
  }
}

this.flush = () => {
  this.camera = null
  this.flushOutput()
}

this.init = input => {
  this.material = new THREE.MeshBasicMaterial( { 
    	color: 0xffffff, 
    	wireframe: true,
      wireframeLinewidth: 2
  	}
  )
}

this.process = input => {
  return {
    Material: this.material
  }
}

this.flush = () => {
  this.material.dispose()
  this.material = null
  this.flushOutput()
}

this.init = () => {}
this.process = () => {
  return {
    X: 0.005,
    Y: 0,
    Z: 0
  }
}
this.flush = () => {
  this.flushOutput()
}

this.init = input => {
  this.geometry = new THREE.IcosahedronGeometry(
    600,
    1
  )
}

this.process = input => {
  return {
    Geometry: this.geometry
  }
}

this.flush = () => {
  this.geometry.dispose()
  this.geometry = null
  this.flushOutput()
}

this.init = input => {
  this.mesh = new THREE.Mesh(
    input.Geometry,
    input.Material
  )
}

this.process = input => {
  this.mesh.rotation.y += input.Data
  return {
    Mesh: this.mesh
  }
}

this.flush = () => {
  this.mesh = null
  this.flushOutput()
}

this.init = input => {
  this.scene = new THREE.Scene()
  this.mesh = input.Object3D
  this.scene.add( this.mesh )
}

this.process = input => {
  return {
    Scene: this.scene
  }
}

this.flush = () => {
  this.scene.remove( this.mesh )
  this.scene = null
  this.flushOutput()
}

this.init = input => {
  this.renderer = window.RENDERER
  this.renderer.setClearColor( 0x000000, 0 )
  this.renderer.clear()
}

this.process = input => {
  this.renderer.render( input.Scene, input.Camera )
}

this.flush = () => {
  this.flushOutput()
}
